.com/apps/MapSeries/index.html?appid=33caf0001a484afea3b555acb0a199cd' target='_blank'>Demographics and Statistics Atlas</a> app.</div><div><br /></div><div>The layers in this map provide unique capabilities for customization, high-resolution display, and offline use in mobile devices: They are built using the same data sources used for the <a href='https://www.arcgis.com/home/item.html?id=8b3d38c0819547faa83f7b7aca80bd76' target='_blank'>Light Gray Canvas</a> and other Esri basemaps.  </div><div><br /></div><div>This map was designed and created by Andrew Skinner.</div><div><br /></div>","tags":["vector","basemap","esri_vector","sample","web map","human geography","esri_basemap","Andrew Skinner","style"],"snippet":"This web map consists of vector tile layers that form a detailed basemap for the world, featuring a monochromatic style with content adjusted to support Human Geography information.","thumbnail":"thumbnail/thumbnail1579117155225.jpeg","documentation":null,"extent":[[-155.166,-45.5959],[104.4629,66.854]],"categories":[],"spatialReference":null,"accessInformation":"Sources: Esri, HERE, Garmin, FAO, NOAA, USGS, © OpenStreetMap contributors, and the GIS User Community","licenseInfo":"<img alt='' src='https://downloads.esri.com/blogs/arcgisonline/esrilogo_new.png' /> This work is licensed under the Esri Master License Agreement.<br /><div><a href='https://goto.arcgis.com/termsofuse/viewsummary' target='_blank'><b>View Summary</b></a> | <b><a href='https://goto.arcgis.com/termsofuse/viewtermsofuse' target='_blank'>View Terms of Use</a></b></div><div><br /></div><div>Alignment of boundaries is a presentation of the feature provided by our data vendors and does not imply endorsement by Esri or any governing authority.<br /></div>","culture":"en-us","properties":null,"advancedSettings":null,"url":null,"proxyFilter":null,"access":"public","size":1158,"subInfo":0,"appCategories":[],"industries":[],"languages":[],"largeThumbnail":"largethumbnail/HumanGeog_ThumbLarge
